import React from 'react';
import './components.css';

const AboutMe = () => {
  return (
    <section id="aboutme">
      <h1>About Me</h1>
      <p>Hello! I'm Benjamin Yew and this is my portfolio. I'm a passionate software developer with a knack for creating dynamic and user-friendly web applications. With a strong foundation in technologies like React, Node.js, and Sequelize, I thrive on solving complex problems and building innovative solutions. My journey into the tech world started with a curiosity for how things work and a desire to create. Over the years, I've honed my skills in front-end and back-end development, constantly learning and adapting to new challenges.

When I'm not coding, you can find me exploring the latest tech trends, working on personal projects, or indulging in my hobbies. I'm excited to connect and collaborate on exciting opportunities in the tech space!</p>
    </section>
  );
};

export default AboutMe;
